translations['da']['encryptionModalHeaderHowItWorks'] = "Hvordan Filen viker";
translations['da']['encryptionModalHowItWorksText'] = "Som du måske allerede ved, er Filen den sikreste måde at gemme dine filer på. Men hvordan fungerer det? Det er faktisk ret simpelt. Når du uploader en fil til Filen, uploader du faktisk ikke en fil, du uploader klumper af krypteret tekst. Før du starter en upload, klipper din browser din fil i 1 MB stykker, krypterer dem ved hjælp af AES-kryptering og sender derefter den krypterede streng til vores servere. På den måde forlader den faktiske fil aldrig din computer. Selv filnavne og metadata er krypteret. Når du downloader en fil, beder din browser om alle filstykker fra Filens servere, dekrypterer dem ved hjælp af dekrypteringsnøglen og genopbygger derefter hele filen igen. På denne måde kan du være sikker på, at din fil altid er sikker og ikke kan læses af nogen, medmindre de har dekrypteringsnøglen. Ikke engang VI ved, hvad du har uploadet.";
